<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Family Dashboard - Deep Hits</title>
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=DM+Sans:wght@400;500;600;700&display=swap" rel="stylesheet">
  <style>
    :root {
      --bg: #0f172a;
      --card: #1e3a5f;
      --card-hover: #334155;
      --accent: #38bdf8;
      --accent-dim: #0ea5e9;
      --hepn: #22d3ee;
      --text: #f8fafc;
      --text-muted: #94a3b8;
    }
    * { box-sizing: border-box; }
    body {
      margin: 0;
      padding: 2rem;
      font-family: 'DM Sans', system-ui, sans-serif;
      background: var(--bg);
      color: var(--text);
      min-height: 100vh;
    }
    .header {
      margin-bottom: 2rem;
    }
    h1 {
      font-size: 1.75rem;
      font-weight: 700;
      margin: 0 0 0.25rem 0;
      color: var(--text);
    }
    .subtitle {
      color: var(--text-muted);
      font-size: 0.95rem;
    }
    .controls {
      margin-bottom: 2rem;
    }
    select {
      padding: 0.6rem 1rem;
      font-size: 1rem;
      font-family: inherit;
      background: var(--card);
      color: var(--text);
      border: 1px solid var(--accent-dim);
      border-radius: 8px;
      cursor: pointer;
      min-width: 180px;
    }
    select:hover, select:focus {
      outline: none;
      border-color: var(--accent);
    }
    .panel {
      display: none;
      background: var(--card);
      border-radius: 12px;
      padding: 1.5rem;
      box-shadow: 0 4px 6px -1px rgba(0,0,0,0.3);
    }
    .panel.active {
      display: block;
    }
    .family-summary {
      color: var(--text-muted);
      margin-bottom: 1.5rem;
      font-size: 0.9rem;
    }
    .member-card {
      background: var(--bg);
      border-radius: 10px;
      padding: 1.25rem;
      margin-bottom: 1rem;
      border-left: 4px solid var(--accent);
    }
    .member-card:hover {
      background: var(--card-hover);
    }
    .member-header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 0.75rem;
      flex-wrap: wrap;
      gap: 0.5rem;
    }
    .member-id {
      font-weight: 600;
      font-size: 1.05rem;
      color: var(--accent);
    }
    .member-length {
      color: var(--text-muted);
      font-size: 0.9rem;
    }
    .bar-container {
      position: relative;
      height: 24px;
      background: var(--card);
      border-radius: 6px;
      margin-bottom: 0.75rem;
      overflow: hidden;
    }
    .bar-track {
      position: absolute;
      left: 0;
      top: 0;
      height: 100%;
      width: 100%;
      background: linear-gradient(90deg, rgba(56,189,248,0.15) 0%, rgba(14,165,233,0.1) 100%);
      border-radius: 6px;
    }
    .bar-hepn {
      position: absolute;
      top: 0;
      height: 100%;
      background: var(--hepn);
      opacity: 0.85;
      border-radius: 4px;
    }
    .hepn-table {
      width: 100%;
      font-size: 0.85rem;
      border-collapse: collapse;
    }
    .hepn-table th {
      text-align: left;
      padding: 0.4rem 0.6rem;
      color: var(--text-muted);
      font-weight: 500;
    }
    .hepn-table td {
      padding: 0.4rem 0.6rem;
      border-top: 1px solid var(--card-hover);
    }
    .no-hepn {
      color: var(--text-muted);
      font-style: italic;
      font-size: 0.9rem;
    }
  </style>
</head>

    function renderFamily(fid) {
      if (!fid || !data[fid]) return '';
      const members = data[fid];
      let html = `<div class="panel active">
        <div class="family-summary">Family ${fid}: ${members.length} member(s)</div>`;

      members.forEach(m => {
        html += `<div class="member-card">
          <div class="member-header">
            <span class="member-id">${m.id}</span>
            <span class="member-length">${m.length} aa</span>
          </div>
          <div class="bar-container">
            <div class="bar-track"></div>`;
        m.hepn.forEach(h => {
          const left = (h.start / m.length) * 100;
          const w = (h.length / m.length) * 100;
          html += `<div class="bar-hepn" style="left:${left}%; width:${w}%" title="${h.motif}"></div>`;
        });
        html += `</div>`;
        if (m.hepn.length) {
          html += `<table class="hepn-table">
            <thead><tr><th>#</th><th>Start</th><th>End</th><th>Length</th><th>Motif</th></tr></thead>
            <tbody>`;
          m.hepn.forEach((h, i) => {
            html += `<tr><td>${i+1}</td><td>${h.start}</td><td>${h.end}</td><td>${h.length}</td><td>${h.motif}</td></tr>`;
          });
          html += `</tbody></table>`;
        } else {
          html += `<p class="no-hepn">No HEPN domains detected</p>`;
        }
        html += `</div>`;
      });

      html += `</div>`;
      return html;
    }

    const select = document.getElementById('family-select');
    const panels = document.getElementById('panels');

    function update() {
      const fid = select.value;
      panels.innerHTML = fid ? renderFamily(fid) : '';
    }

    select.addEventListener('change', update);
    if (select.value) update();
  </script>
